class Node:    def __init__(self, data):        self.prev = None        self.data = data        self.next = Noneclass DLinkedList:    def __init__(self):        self.head = None    def append(self, data):        new_node = Node(data)        if self.head is None:            self.head = new_node            return        last_node = self.head        while last_node.next:            last_node = last_node.next        last_node.next = new_node        new_node.prev = last_node    def get_all(self):        ls = []        cur = self.head        while cur.next:            ls.append(cur.data)            cur = cur.next        ls.append(cur.data)        return lsdlist = DLinkedList()dlist.append(1)dlist.append(2)dlist.append(3)dlist.append(4)dlist.append(5)print(dlist.get_all())print(dlist.head.next.next.prev.next.data)